import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-deminscri',
  templateUrl: './deminscri.component.html',
  styleUrls: ['./deminscri.component.css'],
})
export class DeminscriComponent implements OnInit {
  item: string | null = null;
  title: string = 'Form';
  formGroup!: FormGroup;
  dynamicFields: any[] = [];

  // Configuration for forms based on the selected item
  formsConfig: { [key: string]: any } = {
    'mapping-request': {
      title: 'مطلب ترسيم',
      fields: [
        { label: 'Field 1', type: 'text', formControlName: 'field1' },
        { label: 'Field 2', type: 'number', formControlName: 'field2' },
      ],
    },
    'ownership-deed': {
      title: 'سند ملكية',
      fields: [
        { label: 'Name', type: 'text', formControlName: 'name' },
        { label: 'Document ID', type: 'text', formControlName: 'documentId' },
      ],
    },
    // Add more forms here...
  };

  constructor(private route: ActivatedRoute, private fb: FormBuilder) {}

  ngOnInit(): void {
    // Get the item from the route
    this.item = this.route.snapshot.paramMap.get('item');

    // Load the form configuration based on the item
    const formConfig = this.formsConfig[this.item || ''];

    if (formConfig) {
      this.title = formConfig.title;
      this.dynamicFields = formConfig.fields;

      // Initialize the form group dynamically
      const formControls: { [key: string]: any } = {};
      formConfig.fields.forEach((field: any) => {
        formControls[field.formControlName] = ['', Validators.required];
      });

      this.formGroup = this.fb.group(formControls);
    } else {
      console.error('No form configuration found for:', this.item);
    }
  }

  // Handle form submission
  onSubmit(): void {
    if (this.formGroup.valid) {
      console.log('Form Submitted for:', this.item);
      console.log('Form Values:', this.formGroup.value);
      alert('Form submitted successfully!');
    } else {
      alert('Please fill all required fields.');
      this.formGroup.markAllAsTouched();
    }
  }
}
<div class="container mt-5">
  <h2>{{ title }}</h2>

  <!-- Form for "mapping-request" -->
  <div *ngIf="item === 'mapping-request'">
    <h3>مطلب ترسيم</h3>
    <form (ngSubmit)="onSubmit()">
      <div class="mb-3">
        <label for="field1" class="form-label">Field 1</label>
        <input
          type="text"
          id="field1"
          [(ngModel)]="field1"
          name="field1"
          class="form-control"
          required
        />
        <div *ngIf="!field1 && submitted" class="text-danger">
          Field 1 is required.
        </div>
      </div>
      <div class="mb-3">
        <label for="field2" class="form-label">Field 2</label>
        <input
          type="number"
          id="field2"
          [(ngModel)]="field2"
          name="field2"
          class="form-control"
          required
        />
        <div *ngIf="!field2 && submitted" class="text-danger">
          Field 2 is required.
        </div>
      </div>
      <button type="submit" class="btn btn-primary">Submit</button>
    </form>
  </div>

  <!-- Form for "ownership-deed" -->
  <div *ngIf="item === 'ownership-deed'">
    <h3>سند ملكية</h3>
    <form (ngSubmit)="onSubmit()">
      <div class="mb-3">
        <label for="name" class="form-label">Name</label>
        <input
          type="text"
          id="name"
          [(ngModel)]="name"
          name="name"
          class="form-control"
          required
        />
        <div *ngIf="!name && submitted" class="text-danger">
          Name is required.
        </div>
      </div>
      <div class="mb-3">
        <label for="documentId" class="form-label">Document ID</label>
        <input
          type="text"
          id="documentId"
          [(ngModel)]="documentId"
          name="documentId"
          class="form-control"
          required
        />
        <div *ngIf="!documentId && submitted" class="text-danger">
          Document ID is required.
        </div>
      </div>
      <button type="submit" class="btn btn-primary">Submit</button>
    </form>
  </div>

  <!-- Add more forms for other items as needed -->
</div>
